int main(int argc, char *argv[])
{
	struct wally_psbt *psbt;
	u8 *data;

	common_setup(argv[0]);
	chainparams = chainparams_for_network("bitcoin");

	for (size_t i = 0; i < ARRAY_SIZE(psbts); i++) {
		data = tal_hexdata(tmpctx, psbts[i], strlen(psbts[i]));
		psbt = psbt_from_bytes(tmpctx, data, tal_bytelen(data));
		if (psbt) {
			/* FIXUP should be a noop! */
			assert(psbt_fixup(tmpctx, data) == NULL);
		} else {
			const u8 *data2 = psbt_fixup(tmpctx, data);
			assert(data2);
			psbt = psbt_from_bytes(tmpctx, data2, tal_bytelen(data2));
			assert(psbt);
		}
	}

	common_shutdown();
	return 0;
}
